import React, { Component } from "react";
import { TextField, Button } from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import { connect } from "react-redux";
import CancelPresentationOutlinedIcon from "@mui/icons-material/CancelPresentationOutlined";
import AddOutlinedIcon from "@mui/icons-material/AddOutlined";
import "react-phone-number-input/style.css";
import PhoneInput from "react-phone-number-input";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import MenuItem from "@mui/material/MenuItem";
import InputLabel from "@mui/material/InputLabel";
import actions from "./../../actions/userActions";
import "./Chat.css";
class Chat extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: "",
      listUser: [],
      username: "",
      email: "",
      password: "",
      address: "",
      numberphone: "",
      role: "",
      toggleForm: true,
      isLoading: true,
    };
  }
  componentDidMount() {
    this.props.getAllUser();
  }

  render() {
    const rows = [...this.props.listUser];
    const columns = [
      { field: "id", headerName: "ID", width: 70, headerAlign: "center" },
      {
        field: "username",
        headerName: "Username",
        width: 100,
      },
      {
        field: "email",
        headerName: "Email",
        width: 200,
      },
      {
        field: "role",
        headerName: "Role",
        width: 100,
      },
      {
        field: "password",
        headerName: "Password",
        width: 100,
      },
      {
        field: "address",
        headerName: "Address",
        width: 100,
        type: "text",
      },
      {
        field: "numberphone",
        headerName: "Number Phone",
        width: 100,
        type: "text",
      },
      {
        field: "button",
        headerName: "Action",
        width: 200,

        renderCell: (cellValues) => {
          return (
            <>
              <Button
                className="edit"
                variant="contained"
                color="success"
                onClick={() => this.handleUpdateUser(cellValues)}
              >
                EDIT
              </Button>
              <Button
                variant="contained"
                color="warning"
                onClick={() => this.handleClick(cellValues)}
              >
                DELETE
              </Button>
            </>
          );
        },
        headerAlign: "center",
      },
    ];
    return (
      <div className="container">
        {this.state.toggleForm ? (
          <div className="form">
            <span className="text-controll">FORM COTROLL CUSTOMER</span>
            <CancelPresentationOutlinedIcon
              onClick={this.handleCloseForm}
              className="close-button"
            ></CancelPresentationOutlinedIcon>
            <div className>
              <TextField
                onChange={this.handleOnChange}
                className="input"
                id="outlined-basic"
                label="User Name"
                variant="standard"
                size="small"
                name="username"
                value={this.state.username}
              />

              <Button
                variant="contained"
                color="success"
                className="success-btn"
              >
                {this.state.id ? `Update` : `Register`}
              </Button>
            </div>
          </div>
        ) : (
          ""
        )}
        <>
          <div className="data">
            <Button
              onClick={this.handleToggleForm}
              style={{ marginBottom: "20px" }}
              className="edit"
              variant="contained"
              color="success"
            >
              Add Account
              <AddOutlinedIcon style={{ paddingLeft: "10px" }} />
            </Button>
            <DataGrid rows={rows} columns={columns} pageSize={4} />
          </div>
          <div className="user">
            <div className="hot-customer">
              <span className="top-customer">TOP CUSTOMER :v</span>
            </div>
            <div className="active-customer">
              <h3>New Customer</h3>
              <DataGrid rows={rows} columns={columns} pageSize={6} autoHeight />
            </div>
          </div>
        </>
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return { listUser: state.listUser };
};
const mapDispatchToProps = (dispatch) => {
  return {
    getAllUser: () => {
      dispatch(actions.getAllUser());
    },
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(Chat);
